import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header className="bg-blue-600 text-white p-4">
      <nav className="container mx-auto flex justify-between items-center">
        <h1 className="text-2xl font-bold">Insurance Co.</h1>
        <div className="space-x-4">
          <Link to="/" className="hover:text-blue-200">Home</Link>
          <Link to="/health-insurance" className="hover:text-blue-200">Health Insurance</Link>
          <Link to="/contact-us" className="hover:text-blue-200">Contact Us</Link>
          <Link to="/query-form" className="hover:text-blue-200">Query Form</Link>
          <Link to="/about-us" className="hover:text-blue-200">About Us</Link>
        </div>
      </nav>
    </header>
  );
};

export default Header;
